About Game:
************
Little creature Pete cannot live a day without something tasty! But unfortunately he has already eaten all the candies that he had. Now he needs to travel around the magical world of the sweets to find his favorite candies. Join him in his fantastic trip!

Game Features:
**************
- More than 100 fascinating and challenging puzzle levels
- Colorful and tasty art
